import React from "react";

import Image from "next/image";

import { PictureContainer } from "./styles";

function ProfilePicture() {
  return (
    <PictureContainer>
      <Image
        src="/images/lq_1.jpg"
        alt="Long-Quan"
        layout="fill"
        objectFit="contain"
        quality={75}
      />
    </PictureContainer>
  );
}

export default ProfilePicture;
